import React, { useState, useEffect } from 'react'
import { Link } from 'react-router-dom';
import { parseLocalJwt, splitUrl } from '../commons/Utils'
import '../../App.css'

function NavBar() {
    const [page, setPage] = useState("");
    const [count, setCount] = useState(0);
    const [url, setUrl] = useState(splitUrl(window.location.pathname)[0]);
    const [logged, setLogged] = useState(false);

    useEffect(() => {
        console.log('componentWillUpdate- runs on every update');
        setUrl(splitUrl(window.location.pathname)[0]);


        if (localStorage.getItem('token') != null) {
            setLogged(true);
        } else {
            setLogged(false);
        }

        console.log("URL " + url);
        console.log("isLogged" + logged)

    }, [url])

    function logoutUser() {
        localStorage.clear();
    }

    return (
        <nav className="w-64">
            <div className="overflow-y-auto py-4 px-3 bg-gray-50 rounded dark:bg-gray-800">
                <div className="mb-5 border-b pb-3">
                    <a className="text-3xl font-bold border-l-gray-700" href="/" >codeflex</a>
                </div>
                {logged ?
                    <div>
                        {/* USER IS LOGGED IN */}
                        <div className="" id="myNavbar">
                            <ul className="">

                            </ul>
                            <ul class="space-y-2">
                                <li>
                                    <a href="#" class="flex items-center p-2 text-base font-normal text-gray-900 rounded-lg dark:text-white hover:bg-gray-100 dark:hover:bg-gray-700">
                                        <svg class="w-6 h-6 text-gray-500 transition duration-75 dark:text-gray-400 group-hover:text-gray-900 dark:group-hover:text-white" fill="currentColor" viewBox="0 0 20 20" xmlns="http://www.w3.org/2000/svg"><path d="M2 10a8 8 0 018-8v8h8a8 8 0 11-16 0z"></path><path d="M12 2.252A8.014 8.014 0 0117.748 8H12V2.252z"></path></svg>
                                        <span className={url === 'practise ml-3' ? 'active-page ml-3' : 'ml-3'}><Link to="/practise"><p>Practise</p></Link></span>
                                    </a>
                                </li>
                                <li>
                                    <a href="#" class="flex items-center p-2 text-base font-normal text-gray-900 rounded-lg dark:text-white hover:bg-gray-100 dark:hover:bg-gray-700">
                                        <svg class="w-6 h-6 text-gray-500 transition duration-75 dark:text-gray-400 group-hover:text-gray-900 dark:group-hover:text-white" fill="currentColor" viewBox="0 0 20 20" xmlns="http://www.w3.org/2000/svg"><path d="M2 10a8 8 0 018-8v8h8a8 8 0 11-16 0z"></path><path d="M12 2.252A8.014 8.014 0 0117.748 8H12V2.252z"></path></svg>
                                        <span className={url === 'compete ml-3' ? 'active-page ml-3' : 'ml-3'}><Link to="/compete"><p>Compete</p></Link></span>
                                    </a>
                                </li>


                                <li className={url === 'practise' ? 'active-page' : ''}><Link to="/practise"><p>Practise</p></Link></li>
                                <li className={url === 'compete' ? 'active-page' : ''}><Link to="/compete"><p>Compete</p></Link></li>
                                <li className={url === 'leaderboard' ? 'active-page' : ''}><Link to="/leaderboard"><p>Leaderboard</p></Link></li>
                                <li className="">
                                    <Link to="/" className="" data-toggle="dropdown">
                                        <p>
                                            {parseLocalJwt().username}&nbsp;
                                            <span class="caret"></span>
                                        </p>
                                    </Link>

                                    <ul className="">
                                        <li><Link to={"/user/" + parseLocalJwt().username}><p>Profile</p></Link></li>
                                        {parseLocalJwt().role === "CONTENT_MANAGER" ?
                                            <li><Link to="/manage"><p>Manage Content</p></Link></li> : ''
                                        }
                                        <li><Link to="/" onClick={logoutUser}><p>Logout</p></Link></li>
                                    </ul>
                                </li>
                            </ul>
                        </div>
                    </div>

                    :
                    <div>
                        {/* USER IS LOGGED OUT */}
                        <div className="" id="myNavbar">
                            <ul className="">

                            </ul>
                            <ul className="">
                                <li><Link to="/login"><p>Login</p></Link></li>
                            </ul>
                        </div>
                    </div >
                }
            </div>
        </nav>
    );


}

export default NavBar
